import React from "react";
import Radio from "../../../components/radio/Radio";


const Level=()=>{
    return(
        <div>
            What is your highest level of education?
            <Radio name="highSchool" label="High School"/>
            <Radio name="bachelors" label="Bachelors"/>
            <Radio name="masters" label="Masters"/>
            <Radio name="doctorate" label="doctorate"/>
        </div>
    )
}

export default Level;
